import React from 'react';

class Home extends React.Component {
  render() {
    const containerStyle = {  
        position: 'relative',
        textAlign: 'center',
        color: 'white',
        overflow: 'hidden',
    };

    const centeredStyle = {
        position: 'absolute',
        top: '50%',
        left: '50%',
    };

    const imageSrc = 'https://cdn.realestateview.com.au/illuminate/images/1024-max/wp_advice_1674-b-0-110e376206e6c6.jpeg';

    return (
      <div className="container" style={containerStyle}>
        <img src={imageSrc} alt="Snow" style={{ width: '100%', height: '100%', display: 'block', width: '100%'}} />
        <div className="centered" style={centeredStyle}>
          Centered
        </div>
      </div>
    );
  }
}

export default Home;
